import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import data_map from './data_map.json';

const useStyles = makeStyles({
  table: {
    minWidth: 55,
  },
});


export default function SimpleTable() {
  const classes = useStyles();

  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Адрес</TableCell>
            <TableCell align="right">Широта</TableCell>
            <TableCell align="right">Долгота</TableCell>
            <TableCell align="right">Период прогнозирования</TableCell>
            <TableCell align="right">Вероятность нетехнических потерь,%</TableCell>
            <TableCell align="right">Признак (БУ/БД)</TableCell>
            <TableCell align="right">Коментарии</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data_map.map((row) => (
            <TableRow key={row.address}>
              <TableCell component="th" scope="row">{row.address}</TableCell>
              <TableCell align="right">{row.lat}</TableCell>
              <TableCell align="right">{row.lon}</TableCell>
              <TableCell align="right">{row.date_period}</TableCell>
              <TableCell align="right">{row.loss_probability}</TableCell>
              <TableCell align="right">{row.type}</TableCell>
              <TableCell align="right">{row.comments}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
